import styled from 'styled-components';

export const Body = styled.div `
    margin: 0;
    padding: 0;

`
export const MainContainer = styled.div `
    width: 90vw;
    height: 100vh;
    margin-top: 100px;
    display: flex;
    align-content: center;
`
